  Thread t1 = new Thread(new Runnable() {
    public void run() {
      txMgr.removeHostedTXState(txid);
    }
  });
  t1.start();

  t1.join();

  TXStateProxy curTx = txMgr.getHostedTXState(txid);
  assertNull(curTx);

  
  
  assertTrue(txMgr.getLock(tx, txid));
  assertEquals(tx, txMgr.getHostedTXState(txid));

  tx.getLock().unlock();
}

